import React from 'react';
import './App.css';
import MapPage from './pages/MapPage';
import { Button, Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <>
      {/* <MapPage /> */}
      {/* <Button>hello</Button> */}
      <Container className='main-container'>
        <Row>
          <Col>
            <Row>
              <Col>1</Col>
            </Row>
            <Row>
              <Col>2</Col>
            </Row>
          </Col>
          <Col>3</Col>
          <Col>
            <Row>
              <Col>4</Col>
            </Row>
            <Row>
              <Col>5</Col>
            </Row>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default App;
